import PropTypes from 'prop-types'

const Button = ({color,text}) => {
    return ( 
    <button 
    className={`btn btn-outline-${color}`} type="submit">
        {text}
    </button>
    )
}

Button.defaultProps = {
    color: 'light',
    text: "Add"
}

Button.propTypes = {
    color: PropTypes.string.isRequired,
    text: PropTypes.string.isRequired
}


export default Button
